const LapRunners = (runners, setRunners, resetRunners) => (
  <div style={{ textAlign: "center" }}>
    <div>
      <span>Tracking </span>
      <span>
        {" "}
        <input type="number" />{" "}
      </span>
      <span> Runners</span>
    </div>

    {/* Buttons */}
    <div>
      {runners == null ? `null: ` + runners : `not null`}
      <div>Start</div>
      <div>Reset</div>
    </div>
  </div>
);

export default LapRunners;
